module.exports = "<div class=\"numerizer\">\r\n\t<h1>NUMERIZER</h1>\r\n\t<div class=\"description\">\r\n\t\tWe all have problems, however experienced and fluent we may be, with numbers when they are coming fast in a speech in a foreing language.\r\n\t\tThe application was designed for (future) interpreters and language learners by a professional interpreter with the aim to provide an unlimited source of challenging exercises:\r\n\t</div>\r\n\t<ul>\r\n\t\t<li>Noting down every number in a sequence</li>\r\n\t\t<li>Shadowing (repeating after the speaker first being just one number behind the original and then progressively trying to stay further behind)</li>\r\n\t\t<li>Simultaneous or consecutive interpreting</li>\r\n\t</ul>\r\n\t<div>Should you have any questions, suggestions or further ideas, feel free to contact me (see contact section)</div>\r\n\t<div>\r\n\t\tThe application is free to use by private individuals as well as educational institutions.<br>\r\n<!-- \t\tShould you consider contributing to its maintenance and further development, you can make a Paypal trasfer here. -->\r\n\t</div>\r\n</div>";

